const TableBranches = () => {
  return (
    <Table hover responsive>
      <thead>
        <tr>
          <th>Branch Name</th>
          <th>Created at</th>
          <th>Created by</th>
          {/* <th>Status</th> */}
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>
            <span className='align-middle fw-bold'>South West</span>
          </td>
          <td>Tuesday November 8 2022 10:25</td>
          <td>
            {/* <AvatarGroup data={avatarGroupData1} /> */}
            <img className='me-75' src={avatar1} alt='angular' height='20' width='20' />
            <span className='align-middle fw-bold'>Tomas</span>
          </td>
          {/* <td>
            <Badge pill color='light-primary' className='me-1'>
              Active
            </Badge>
          </td> */}
          <td>
            <UncontrolledDropdown>
              <DropdownToggle className='icon-btn hide-arrow' color='transparent' size='sm' caret>
                <MoreVertical size={15} />
              </DropdownToggle>
              <DropdownMenu>
                <DropdownItem href='/' onClick={e => e.preventDefault()}>
                  <Edit className='me-50' size={15} /> <span className='align-middle'>Edit</span>
                </DropdownItem>
                <DropdownItem href='/' onClick={e => e.preventDefault()}>
                  <Trash className='me-50' size={15} /> <span className='align-middle'>Delete</span>
                </DropdownItem>
              </DropdownMenu>
            </UncontrolledDropdown>
          </td>
        </tr>

      </tbody>
    </Table>
  )
}

export default TableBranches
